query MovieList($limit: Int = 15) {
  movies {
    __typename
    popular(first: $limit) {
      __typename
      edges {
        __typename
        node {
          __typename
          id
          title
          rating
          poster(size: W500)
        }
      }
    }
  }
}

30563a28c4ddc08651a593b5f077b3f01a07c6ba.source:
query MovieDetail($id: Int = 15) {
  movies {
    __typename
    movie(id: $id) {
      __typename
      id
      title
      rating
      poster(size: W500)
    }
  }
}
